<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Entete</title>
  <style>
    .header {
      text-align: center;
      
      top: 0;
      left: 0;
      right: 0;
      height: 100px; /* Adjust height as needed */
      z-index: 1000; /* Ensure header is above other content */
    }
    
    .header img {
      width: 100%;
    }
    
    .footer {
      text-align: center;
      position: fixed;
      bottom: 0;
      left: 0;
      right: 0;
      padding: 10px 0;
      background-color: #ffffff;
    }
    
    .table-container {
      margin-top: 150px; /* Adjust top margin to accommodate header */
    }
    
    .table {
      width: 100%;
      border-collapse: collapse;
      margin-bottom: calc(200px + 10px); /* Adjust bottom margin to accommodate footer */
    }
    
    .table th, .table td {
      border: 1px solid #ddd;
      padding: 8px;
      text-align: left;
    }
    
    @page {
      size: A4;
      margin: 20px 40px 0; /* Adjust margins to accommodate header and footer */
    }
    
   
    @media print {
      html, body {
        width: 210mm;
        height: 297mm;
      }
    }
  
    
    .total-price {
      margin-top: 20px;
      text-align: right;
    }
    
    .total-price p {
      font-weight: bold;
    }
    
    .total-price span {
      color: blue; /* Adjust color as needed */
    }
      </style>
  
</head>
